import React from 'react';
import CompanyCard from './CompanyCard';
import { Container } from 'reactstrap'

const CompanyList = ({ companies }) => {
  return (
    <Container>
      {companies.map(company => <CompanyCard />)}
    </Container>
  )
};

export default CompanyList;
